import { createStore } from 'vuex'

//https://www.youtube.com/watch?v=im-fzWGZilo&list=PLfpRlCqycThkmL-HIcAf542NefEZtQFrV&index=7
// 7:33초


createStore({
    state(){
        return {
            user: {}
        }
    },
    metations: {
        setUser(state,value){
            state.user = value;
        }
    }
})
